import React, {Component} from 'react';
import './OrderItem.css';
import {Link} from 'react-router-dom';

class SearchItem extends Component{


    render(){
        const{id,name, tag, price, photo, orderdate, cancel, address, provider} = this.props;

        return(
            <Link to={`/orders/${id}`}>
                <div className="order-wrapper">
                    <div className="order-item" >
                        <div className = "order-photo">
                            <img src={photo}/>
                        </div>
                        <div className = "order-discription">
                            <div className ="name-price">
                                <div className = "order-item-name">[{name}]</div>
                                <div className = "order-price"><span className = "tag-pod">price</span> {price} won</div>
                            </div>
                            <div className = "order-others">
                                <div className = "address">{address}</div>
                                <div className = "provider">{provider}</div>
                                <div className = "orderdate">{orderdate}</div>
                                <div className = "order-tag"># {tag}</div>
                            </div>
                        </div>
                    </div>
                </div>
            </Link>
        )
    }
}

export default SearchItem;
